import React from 'react'
import MyComponent from './Datadog/MyComponent'
import Table from './Datadog/Table';
import './index.css'
const App = () => {
  const data = "Ajith";
  return (
    <div>
        <MyComponent prop={data}/>
        <Table/>
    </div>
  )
}

export default App
